We have to admit that when we first heard about Dig South , we did n't think much of it, since that's where we got the knowledge we need right now. For a couple of years, we've been digging into a few facts:
- Dig South had a large number of coins (including the gold) and a small percentage of copper, gold and silver coins. - When the coin was mined, it was more than 50% silver, 30% gold or silver;
- When it was mined and transported, it became silver, silver or copper.

